// contracts/MyContract.sol
pragma solidity ^0.8.0;

/**
 * @title PatientRecordSystem
 * @dev A simple smart contract to store and manage patient records.
 * The structure mimics the fields shown in the provided database image.
 */
contract PatientRecordSystem {
    // --- 1. Define the Data Structure (Patient) ---
    // A structure to hold the patient's data, similar to a database row.
    struct Patient {
        uint patientId;          // Corresponding to the 'patientId' column
        string patientName;      // Corresponding to 'patientName'
        string icNumber;         // Corresponding to 'ic_number'
        string gender;           // Corresponding to 'gender'
        string email;            // Corresponding to 'email'
        string phone;            // Corresponding to 'phone'
        string homeAddress;      // Corresponding to 'address'
        // We'll omit 'created_at', 'updated_at', and 'doctorId' for simplicity
        // as timestamps and foreign keys are complex in basic Solidity.
    }

    // --- 2. State Variables ---
    // A mapping to store Patient structs, indexed by their unique ID.
    // This is the core storage mechanism.
    mapping(uint => Patient) public patients;

    // A counter to assign the next unique ID. We'll start from 11 since your
    // sample data goes up to ID 10.
    uint public nextPatientId = 11;

    // --- 3. Function to Create Data ---

    /**
     * @dev Creates a new patient record and stores it in the mapping.
     * @param _name The patient's full name.
     * @param _ic The patient's IC/National ID number.
     * @param _gender The patient's gender.
     * @param _email The patient's email address.
     * @param _phone The patient's phone number.
     * @param _address The patient's home address.
     */
    function createPatient(
        string memory _name,
        string memory _ic,
        string memory _gender,
        string memory _email,
        string memory _phone,
        string memory _address
    ) public {
        // 1. Store the data using the current ID
        patients[nextPatientId] = Patient(
            nextPatientId,
            _name,
            _ic,
            _gender,
            _email,
            _phone,
            _address
        );

        // 2. Increment the counter for the next record
        nextPatientId++;
    }

    // --- 4. Function to Read Data (Optional but recommended) ---

    /**
     * @dev Retrieves a patient record by their ID.
     * @param _id The patient ID to look up.
     * @return All fields of the patient record.
     */
    function getPatient(uint _id) public view returns (
        uint,
        string memory,
        string memory,
        string memory,
        string memory,
        string memory,
        string memory
    ) {
        Patient storage patient = patients[_id];
        return (
            patient.patientId,
            patient.patientName,
            patient.icNumber,
            patient.gender,
            patient.email,
            patient.phone,
            patient.homeAddress
        );
    }
}

